      const {x,y,z,n,p}=props
    return(
        <div>
            <p>ID:{x}</p>
            <p>Name:{y}</p>
            <p>State:{z}</p>
            <p>Mobile:{n}</p>
            <p>Country:{p}</p>
        </div>
    )
}
export default One;
